import React from "react";
import Layout from "../components/Layout";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import "../pages/Contact.css";
import {
  FaLinkedin,
  FaGithub,
  FaEnvelope,
  FaCloudDownloadAlt,
} from "react-icons/fa";

const Contact = () => {
  return (
    <div>
      <Layout>
        <div className="sidebar">
          <a
            href="https://www.linkedin.com/"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaLinkedin size={40} />
          </a>
          <a
            href="https://github.com/"
            target="_blank"
            rel="noopener noreferrer"
          >
            <FaGithub size={40} />
          </a>
          <a href="mailto:youremail@example.com">
            <FaEnvelope size={40} />
          </a>
          <a href="/path/to/file" download>
            <FaCloudDownloadAlt size={40} />
          </a>
        </div>

        <div>
          <Card className="eventForm">
            style={{ width: "18rem" }}
            {/* <Card.Img variant="top" src="holder.js/100px180" /> */}
            <Card.Body>
              <Card.Title>
                Get in touch by leaving your details below
              </Card.Title>
              <Card.Text>What's your name?</Card.Text>
              <input className="nameSub" placeholder="Name"></input>
              <Card.Text>Enter your email address below</Card.Text>
              <input
                className="mailSub"
                placeholder="Enter your email here"
              ></input>
              <Card.Text>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </Card.Text>
              <Button variant="dark">Go somewhere</Button>
            </Card.Body>
          </Card>
        </div>
      </Layout>
    </div>
  );
};

export default Contact;

// Email address

// Link to a PDF version of your CV

// Link to your GitHub profile

// Link to your LinkedIn page

// Must have a contact form for handling events
